query:
/*+ NoMergeJoin(mc t mi_idx) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id = 575 AND mc.company_type_id = 2 AND t.kind_id < 7 AND t.production_year < 2010
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id < 101;
